module O_GaussianIntegrals

   ! Import necessary modules.
   use O_Kinds

   ! Make sure that no funny variables are defined.
   implicit none

   ! Define access
   public

   
   !!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!
   ! Begin list of module subroutines.!
   !!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!
   contains

!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!
! This subroutine computes the solution formulas for 3-center nuclear
! attraction integrals.  Positions A and B involve s-,  p-, d-, 
! or f-type orbitals, while the third (nuclear) C position 
! is an s-type Gaussian function.  This formalism is readily 
! extendable to orbitals higher than f-type (g-type orbitals, etc.).
! The azimuthal quantum numbers are arranged according to the 
! "triad" formalism established by Browne & Poshusta in 1962, 
! the reference for which is the following:
! 
! ****************************************************************
! Browne JC, Poshusta RD., "Quantum-Mechanical Integrals 
! over Gaussian Atomic Orbitals.", The Journal of Chemical Physics, 
! Vol. 36, Iss. 7, P. 19337, (1962).
! ****************************************************************
!
! The formalism for the solution to the integrals comes from the
! following source:
!
! ****************************************************************
! Cook, David B., "Handbook of Computational Quantum Chemistry."
! Dover Publications (August 22, 2005).
! ISBN-10: 0486443078
! ISBN-13: 978-0486443072
! ****************************************************************
! 
! All the subroutines in this program use this formalism, so the 
! variables used and style of the formulas are the same.
!
!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!
      subroutine nucPotInteg(a1,a2,a3,A,B,C,l1l2Switch,g)

      use O_Kinds
      use O_Constants, only: pi

      implicit none
! c
! c     g(16,16): 1,s; 2,x; 3,y; 4,z; 5,xy; 6,xz; 7,yz; 8,xx-yy;
! c     9,2zz-xx-yy; 10,xyz; 11,xxz-yyz; 12,xxx-3yyx; 13,3xxy-yyy; 
! c     14,2zzz-3xxz-3yyz; 15,4zzx-xxx-yyx; 16,4zzy-xxy-yyy
! c
! c     wo(20,20): 1,s; 2,x; 3,y; 4,z; 5,xx; 6,yy; 7,zz; 8,xy; 9,xz;
! c     10,yz; 11,xyz; 12,xxy; 13,xxz; 14,yyx; 15,yyz; 16,zzx; 17,zzy
! c     18,xxx; 19,yyy; 20,zzz
! c 
      ! define the dummy variables passed to this subroutine.
      real (kind=double), dimension (16,16), intent (out) :: g
      real (kind=double), intent (in) :: a1, a2, a3
      real (kind=double), dimension (3), intent (in) :: A, B, C
      integer, intent (in) :: l1l2Switch

      ! define local variables
      real (kind=double), dimension(20,20) :: nuc
      real (kind=double) :: F0, F1, F2, F3, F4, F5, F6, XX
      real (kind=double) :: preFactor, expFactor, eps, Y
      real (kind=double), dimension(3) :: P, PA, PB, PC, d1, d2, d3

      d1 = A - B
      d2 = A - C
      d3 = B - C
      Y = a1 + a2 + a3
      P = (a1*A + a2*B + a3*C)/Y
      PA = P - A
      PB = P - B
      PC = P - C
      XX = sum(Y*(P - C)**2)
      expFactor = sum(a1*a2*(d1**2) + a1*a3*(d2**2) + a2*a3*(d3**2))/Y
      preFactor = (2.d0*pi/Y)*dexp(-expFactor)
      eps = 1/(4*Y)
  
      nuc = 0.0_double
      g = 0.0_double

      !call incompleteGamma(XX,F0,F1,F2,F3,F4,F5,F6)
      !call fmtcf(XX,F0,F1,F2,F3,F4,F5,F6)
      call Boys(XX,F0,F1,F2,F3,F4,F5,F6)

      if (l1l2switch.eq.34) then

      nuc(1,1) = preFactor*F0
      
      nuc(1,2) = preFactor*((PB(1))*F0 - (PC(1))*F1)
      
      nuc(1,3) = preFactor*((PB(2))*F0 - (PC(2))*F1)
      
      nuc(1,4) = preFactor*((PB(3))*F0 - (PC(3))*F1)
      
      nuc(2,1) = preFactor*((PA(1))*F0 - (PC(1))*F1)
      
      nuc(2,2) = preFactor*((PA(1))*(PB(1))*F0 - (PA(1))*(PC(1))*F1 - (PB(1))*(PC(1))&
      &*F1 + ((2*((PC(1))**(2)))/(2.d0))*F2 + (((-1)*2*eps))*F1 + ((2*eps))*F0)
      
      nuc(2,3) = preFactor*((PA(1))*(PB(2))*F0 - (PA(1))*(PC(2))*F1 - (PC(1))*(PB(2))&
      &*F1 + (PC(1))*(PC(2))*F2)
      
      nuc(2,4) = preFactor*((PA(1))*(PB(3))*F0 - (PA(1))*(PC(3))*F1 - (PC(1))*(PB(3))&
      &*F1 + (PC(1))*(PC(3))*F2)
      
      nuc(3,1) = preFactor*((PA(2))*F0 - (PC(2))*F1)
      
      nuc(3,2) = preFactor*((PB(1))*(PA(2))*F0 - (PB(1))*(PC(2))*F1 - (PC(1))*(PA(2))&
      &*F1 + (PC(1))*(PC(2))*F2)
      
      nuc(3,3) = preFactor*((PA(2))*(PB(2))*F0 - (PA(2))*(PC(2))*F1 - (PB(2))*(PC(2))&
      &*F1 + ((2*((PC(2))**(2)))/(2.d0))*F2 + (((-1)*2*eps))*F1 + ((2*eps))*F0)
      
      nuc(3,4) = preFactor*((PA(2))*(PB(3))*F0 - (PA(2))*(PC(3))*F1 - (PC(2))*(PB(3))&
      &*F1 + (PC(2))*(PC(3))*F2)
      
      nuc(4,1) = preFactor*((PA(3))*F0 - (PC(3))*F1)
      
      nuc(4,2) = preFactor*((PB(1))*(PA(3))*F0 - (PB(1))*(PC(3))*F1 - (PC(1))*(PA(3))&
      &*F1 + (PC(1))*(PC(3))*F2)
      
      nuc(4,3) = preFactor*((PB(2))*(PA(3))*F0 - (PB(2))*(PC(3))*F1 - (PC(2))*(PA(3))&
      &*F1 + (PC(2))*(PC(3))*F2)
      
      nuc(4,4) = preFactor*((PA(3))*(PB(3))*F0 - (PA(3))*(PC(3))*F1 - (PB(3))*(PC(3))&
      &*F1 + ((2*((PC(3))**(2)))/(2.d0))*F2 + (((-1)*2*eps))*F1 + ((2*eps))*F0)
      
      g(1,1) = +nuc(1,1)
      g(1,2) = +nuc(1,2)
      g(1,3) = +nuc(1,3)
      g(1,4) = +nuc(1,4)
      g(2,1) = +nuc(2,1)
      g(2,2) = +nuc(2,2)
      g(2,3) = +nuc(2,3)
      g(2,4) = +nuc(2,4)
      g(3,1) = +nuc(3,1)
      g(3,2) = +nuc(3,2)
      g(3,3) = +nuc(3,3)
      g(3,4) = +nuc(3,4)
      g(4,1) = +nuc(4,1)
      g(4,2) = +nuc(4,2)
      g(4,3) = +nuc(4,3)
      g(4,4) = +nuc(4,4)
      
      else if (l1l2switch.eq.17) then
      
      nuc(1,1) = preFactor*F0
      
      g(1,1) = +nuc(1,1)
      
      else if (l1l2switch.eq.33) then
      
      nuc(1,1) = preFactor*F0
      
      nuc(1,2) = preFactor*((PB(1))*F0 - (PC(1))*F1)
      
      nuc(1,3) = preFactor*((PB(2))*F0 - (PC(2))*F1)
      
      nuc(1,4) = preFactor*((PB(3))*F0 - (PC(3))*F1)
      
      g(1,1) = +nuc(1,1)
      g(1,2) = +nuc(1,2)
      g(1,3) = +nuc(1,3)
      g(1,4) = +nuc(1,4)
      
      else if (l1l2switch.eq.65) then
      
      nuc(1,1) = preFactor*F0
      
      nuc(1,2) = preFactor*((PB(1))*F0 - (PC(1))*F1)
      
      nuc(1,3) = preFactor*((PB(2))*F0 - (PC(2))*F1)
      
      nuc(1,4) = preFactor*((PB(3))*F0 - (PC(3))*F1)
      
      nuc(1,5) = preFactor*(((PB(1))**(2))*F0 - (2)*(PB(1))*(PC(1))*F1 + ((2*((PC(1))&
      &**(2)))/(2.d0))*F2 + (((-1)*2*eps))*F1 + ((2*eps))*F0)
      
      nuc(1,6) = preFactor*(((PB(2))**(2))*F0 - (2)*(PB(2))*(PC(2))*F1 + ((2*((PC(2))&
      &**(2)))/(2.d0))*F2 + (((-1)*2*eps))*F1 + ((2*eps))*F0)
      
      nuc(1,7) = preFactor*(((PB(3))**(2))*F0 - (2)*(PB(3))*(PC(3))*F1 + ((2*((PC(3))&
      &**(2)))/(2.d0))*F2 + (((-1)*2*eps))*F1 + ((2*eps))*F0)
      
      nuc(1,8) = preFactor*((PB(1))*(PB(2))*F0 - (PB(1))*(PC(2))*F1 - (PC(1))*(PB(2))&
      &*F1 + (PC(1))*(PC(2))*F2)
      
      nuc(1,9) = preFactor*((PB(1))*(PB(3))*F0 - (PB(1))*(PC(3))*F1 - (PC(1))*(PB(3))&
      &*F1 + (PC(1))*(PC(3))*F2)
      
      nuc(1,10) = preFactor*((PB(2))*(PB(3))*F0 - (PB(2))*(PC(3))*F1 - (PC(2))*(PB(3)&
      &)*F1 + (PC(2))*(PC(3))*F2)
      
      g(1,1) = +nuc(1,1)
      g(1,2) = +nuc(1,2)
      g(1,3) = +nuc(1,3)
      g(1,4) = +nuc(1,4)
      g(1,5) = +nuc(1,8)
      g(1,6) = +nuc(1,9)
      g(1,7) = +nuc(1,10)
      g(1,8) = +nuc(1,5) - nuc(1,6)
      g(1,9) = +2*nuc(1,7) - nuc(1,5) - nuc(1,6)
      
      else if (l1l2switch.eq.129) then
      
      nuc(1,1) = preFactor*F0
      
      nuc(1,2) = preFactor*((PB(1))*F0 - (PC(1))*F1)
      
      nuc(1,3) = preFactor*((PB(2))*F0 - (PC(2))*F1)
      
      nuc(1,4) = preFactor*((PB(3))*F0 - (PC(3))*F1)
      
      nuc(1,5) = preFactor*(((PB(1))**(2))*F0 - (2)*(PB(1))*(PC(1))*F1 + ((2*((PC(1))&
      &**(2)))/(2.d0))*F2 + (((-1)*2*eps))*F1 + ((2*eps))*F0)
      
      nuc(1,6) = preFactor*(((PB(2))**(2))*F0 - (2)*(PB(2))*(PC(2))*F1 + ((2*((PC(2))&
      &**(2)))/(2.d0))*F2 + (((-1)*2*eps))*F1 + ((2*eps))*F0)
      
      nuc(1,7) = preFactor*(((PB(3))**(2))*F0 - (2)*(PB(3))*(PC(3))*F1 + ((2*((PC(3))&
      &**(2)))/(2.d0))*F2 + (((-1)*2*eps))*F1 + ((2*eps))*F0)
      
      nuc(1,8) = preFactor*((PB(1))*(PB(2))*F0 - (PB(1))*(PC(2))*F1 - (PC(1))*(PB(2))&
      &*F1 + (PC(1))*(PC(2))*F2)
      
      nuc(1,9) = preFactor*((PB(1))*(PB(3))*F0 - (PB(1))*(PC(3))*F1 - (PC(1))*(PB(3))&
      &*F1 + (PC(1))*(PC(3))*F2)
      
      nuc(1,10) = preFactor*((PB(2))*(PB(3))*F0 - (PB(2))*(PC(3))*F1 - (PC(2))*(PB(3)&
      &)*F1 + (PC(2))*(PC(3))*F2)
      
      nuc(1,11) = preFactor*((PB(1))*(PB(2))*(PB(3))*F0 - (PB(1))*(PB(2))*(PC(3))*F1 &
      &- (PB(1))*(PC(2))*(PB(3))*F1 + (PB(1))*(PC(2))*(PC(3))*F2 - (PC(1))*(PB(2))*(PB&
      &(3))*F1 + (PC(1))*(PB(2))*(PC(3))*F2 + (PC(1))*(PC(2))*(PB(3))*F2 - (PC(1))*(PC&
      &(2))*(PC(3))*F3)
      
      nuc(1,12) = preFactor*(((PB(1))**(2))*(PB(2))*F0 - ((PB(1))**(2))*(PC(2))*F1 - &
      &(2)*(PB(1))*(PC(1))*(PB(2))*F1 + (2)*(PB(1))*(PC(1))*(PC(2))*F2 + ((2*((PC(1))*&
      &*(2)))/(2.d0))*(PB(2))*F2 - ((2*((PC(1))**(2)))/(2.d0))*(PC(2))*F3 + (((-1)*2*e&
      &ps))*(PB(2))*F1 - (((-1)*2*eps))*(PC(2))*F2 + ((2*eps))*(PB(2))*F0 - ((2*eps))*&
      &(PC(2))*F1)
      
      nuc(1,13) = preFactor*(((PB(1))**(2))*(PB(3))*F0 - ((PB(1))**(2))*(PC(3))*F1 - &
      &(2)*(PB(1))*(PC(1))*(PB(3))*F1 + (2)*(PB(1))*(PC(1))*(PC(3))*F2 + ((2*((PC(1))*&
      &*(2)))/(2.d0))*(PB(3))*F2 - ((2*((PC(1))**(2)))/(2.d0))*(PC(3))*F3 + (((-1)*2*e&
      &ps))*(PB(3))*F1 - (((-1)*2*eps))*(PC(3))*F2 + ((2*eps))*(PB(3))*F0 - ((2*eps))*&
      &(PC(3))*F1)
      
      nuc(1,14) = preFactor*((PB(1))*((PB(2))**(2))*F0 - (PB(1))*(2)*(PB(2))*(PC(2))*&
      &F1 + (PB(1))*((2*((PC(2))**(2)))/(2.d0))*F2 + (PB(1))*(((-1)*2*eps))*F1 + (PB(1&
      &))*((2*eps))*F0 - (PC(1))*((PB(2))**(2))*F1 + (PC(1))*(2)*(PB(2))*(PC(2))*F2 - &
      &(PC(1))*((2*((PC(2))**(2)))/(2.d0))*F3 - (PC(1))*(((-1)*2*eps))*F2 - (PC(1))*((&
      &2*eps))*F1)
      
      nuc(1,15) = preFactor*(((PB(2))**(2))*(PB(3))*F0 - ((PB(2))**(2))*(PC(3))*F1 - &
      &(2)*(PB(2))*(PC(2))*(PB(3))*F1 + (2)*(PB(2))*(PC(2))*(PC(3))*F2 + ((2*((PC(2))*&
      &*(2)))/(2.d0))*(PB(3))*F2 - ((2*((PC(2))**(2)))/(2.d0))*(PC(3))*F3 + (((-1)*2*e&
      &ps))*(PB(3))*F1 - (((-1)*2*eps))*(PC(3))*F2 + ((2*eps))*(PB(3))*F0 - ((2*eps))*&
      &(PC(3))*F1)
      
      nuc(1,16) = preFactor*((PB(1))*((PB(3))**(2))*F0 - (PB(1))*(2)*(PB(3))*(PC(3))*&
      &F1 + (PB(1))*((2*((PC(3))**(2)))/(2.d0))*F2 + (PB(1))*(((-1)*2*eps))*F1 + (PB(1&
      &))*((2*eps))*F0 - (PC(1))*((PB(3))**(2))*F1 + (PC(1))*(2)*(PB(3))*(PC(3))*F2 - &
      &(PC(1))*((2*((PC(3))**(2)))/(2.d0))*F3 - (PC(1))*(((-1)*2*eps))*F2 - (PC(1))*((&
      &2*eps))*F1)
      
      nuc(1,17) = preFactor*((PB(2))*((PB(3))**(2))*F0 - (PB(2))*(2)*(PB(3))*(PC(3))*&
      &F1 + (PB(2))*((2*((PC(3))**(2)))/(2.d0))*F2 + (PB(2))*(((-1)*2*eps))*F1 + (PB(2&
      &))*((2*eps))*F0 - (PC(2))*((PB(3))**(2))*F1 + (PC(2))*(2)*(PB(3))*(PC(3))*F2 - &
      &(PC(2))*((2*((PC(3))**(2)))/(2.d0))*F3 - (PC(2))*(((-1)*2*eps))*F2 - (PC(2))*((&
      &2*eps))*F1)
      
      nuc(1,18) = preFactor*(((PB(1))**(3))*F0 - (3)*((PB(1))**(2))*(PC(1))*F1 + (3)*&
      &(PB(1))*((2*((PC(1))**(2)))/(2.d0))*F2 + (3)*(PB(1))*(((-1)*2*eps))*F1 + (3)*(P&
      &B(1))*((2*eps))*F0 - ((6*((PC(1))**(3)))/(6.d0))*F3 - (((-1)*6*(PC(1))*eps))*F2&
      & - ((6*(PC(1))*eps))*F1)
      
      nuc(1,19) = preFactor*(((PB(2))**(3))*F0 - (3)*((PB(2))**(2))*(PC(2))*F1 + (3)*&
      &(PB(2))*((2*((PC(2))**(2)))/(2.d0))*F2 + (3)*(PB(2))*(((-1)*2*eps))*F1 + (3)*(P&
      &B(2))*((2*eps))*F0 - ((6*((PC(2))**(3)))/(6.d0))*F3 - (((-1)*6*(PC(2))*eps))*F2&
      & - ((6*(PC(2))*eps))*F1)
      
      nuc(1,20) = preFactor*(((PB(3))**(3))*F0 - (3)*((PB(3))**(2))*(PC(3))*F1 + (3)*&
      &(PB(3))*((2*((PC(3))**(2)))/(2.d0))*F2 + (3)*(PB(3))*(((-1)*2*eps))*F1 + (3)*(P&
      &B(3))*((2*eps))*F0 - ((6*((PC(3))**(3)))/(6.d0))*F3 - (((-1)*6*(PC(3))*eps))*F2&
      & - ((6*(PC(3))*eps))*F1)
      
      g(1,1) = +nuc(1,1)
      g(1,2) = +nuc(1,2)
      g(1,3) = +nuc(1,3)
      g(1,4) = +nuc(1,4)
      g(1,5) = +nuc(1,8)
      g(1,6) = +nuc(1,9)
      g(1,7) = +nuc(1,10)
      g(1,8) = +nuc(1,5) - nuc(1,6)
      g(1,9) = +2*nuc(1,7) - nuc(1,5) - nuc(1,6)
      g(1,10) = +nuc(1,11)
      g(1,11) = +nuc(1,13) - nuc(1,15)
      g(1,12) = +nuc(1,18) - 3*nuc(1,14)
      g(1,13) = +3*nuc(1,12) - nuc(1,19)
      g(1,14) = +2*nuc(1,20) - 3*nuc(1,13) - 3*nuc(1,15)
      g(1,15) = +4*nuc(1,16) - nuc(1,18) - nuc(1,14)
      g(1,16) = +4*nuc(1,17) - nuc(1,12) - nuc(1,19)
      
      else if (l1l2switch.eq.18) then
      
      nuc(1,1) = preFactor*F0
      
      nuc(2,1) = preFactor*((PA(1))*F0 - (PC(1))*F1)
      
      nuc(3,1) = preFactor*((PA(2))*F0 - (PC(2))*F1)
      
      nuc(4,1) = preFactor*((PA(3))*F0 - (PC(3))*F1)
      
      g(1,1) = +nuc(1,1)
      g(2,1) = +nuc(2,1)
      g(3,1) = +nuc(3,1)
      g(4,1) = +nuc(4,1)
      
      else if (l1l2switch.eq.66) then
      
      nuc(1,1) = preFactor*F0
      
      nuc(1,2) = preFactor*((PB(1))*F0 - (PC(1))*F1)
      
      nuc(1,3) = preFactor*((PB(2))*F0 - (PC(2))*F1)
      
      nuc(1,4) = preFactor*((PB(3))*F0 - (PC(3))*F1)
      
      nuc(1,5) = preFactor*(((PB(1))**(2))*F0 - (2)*(PB(1))*(PC(1))*F1 + ((2*((PC(1))&
      &**(2)))/(2.d0))*F2 + (((-1)*2*eps))*F1 + ((2*eps))*F0)
      
      nuc(1,6) = preFactor*(((PB(2))**(2))*F0 - (2)*(PB(2))*(PC(2))*F1 + ((2*((PC(2))&
      &**(2)))/(2.d0))*F2 + (((-1)*2*eps))*F1 + ((2*eps))*F0)
      
      nuc(1,7) = preFactor*(((PB(3))**(2))*F0 - (2)*(PB(3))*(PC(3))*F1 + ((2*((PC(3))&
      &**(2)))/(2.d0))*F2 + (((-1)*2*eps))*F1 + ((2*eps))*F0)
      
      nuc(1,8) = preFactor*((PB(1))*(PB(2))*F0 - (PB(1))*(PC(2))*F1 - (PC(1))*(PB(2))&
      &*F1 + (PC(1))*(PC(2))*F2)
      
      nuc(1,9) = preFactor*((PB(1))*(PB(3))*F0 - (PB(1))*(PC(3))*F1 - (PC(1))*(PB(3))&
      &*F1 + (PC(1))*(PC(3))*F2)
      
      nuc(1,10) = preFactor*((PB(2))*(PB(3))*F0 - (PB(2))*(PC(3))*F1 - (PC(2))*(PB(3)&
      &)*F1 + (PC(2))*(PC(3))*F2)
      
      nuc(2,1) = preFactor*((PA(1))*F0 - (PC(1))*F1)
      
      nuc(2,2) = preFactor*((PA(1))*(PB(1))*F0 - (PA(1))*(PC(1))*F1 - (PB(1))*(PC(1))&
      &*F1 + ((2*((PC(1))**(2)))/(2.d0))*F2 + (((-1)*2*eps))*F1 + ((2*eps))*F0)
      
      nuc(2,3) = preFactor*((PA(1))*(PB(2))*F0 - (PA(1))*(PC(2))*F1 - (PC(1))*(PB(2))&
      &*F1 + (PC(1))*(PC(2))*F2)
      
      nuc(2,4) = preFactor*((PA(1))*(PB(3))*F0 - (PA(1))*(PC(3))*F1 - (PC(1))*(PB(3))&
      &*F1 + (PC(1))*(PC(3))*F2)
      
      nuc(2,5) = preFactor*((PA(1))*((PB(1))**(2))*F0 - (2)*(PA(1))*(PB(1))*(PC(1))*F&
      &1 - ((PB(1))**(2))*(PC(1))*F1 + (PA(1))*((2*((PC(1))**(2)))/(2.d0))*F2 + (2)*(P&
      &B(1))*((2*((PC(1))**(2)))/(2.d0))*F2 + (PA(1))*(((-1)*2*eps))*F1 + (2)*(PB(1))*&
      &(((-1)*2*eps))*F1 + (PA(1))*((2*eps))*F0 + (2)*(PB(1))*((2*eps))*F0 - ((6*((PC(&
      &1))**(3)))/(6.d0))*F3 - (((-1)*6*(PC(1))*eps))*F2 - ((6*(PC(1))*eps))*F1)
      
      nuc(2,6) = preFactor*((PA(1))*((PB(2))**(2))*F0 - (PA(1))*(2)*(PB(2))*(PC(2))*F&
      &1 + (PA(1))*((2*((PC(2))**(2)))/(2.d0))*F2 + (PA(1))*(((-1)*2*eps))*F1 + (PA(1)&
      &)*((2*eps))*F0 - (PC(1))*((PB(2))**(2))*F1 + (PC(1))*(2)*(PB(2))*(PC(2))*F2 - (&
      &PC(1))*((2*((PC(2))**(2)))/(2.d0))*F3 - (PC(1))*(((-1)*2*eps))*F2 - (PC(1))*((2&
      &*eps))*F1)
      
      nuc(2,7) = preFactor*((PA(1))*((PB(3))**(2))*F0 - (PA(1))*(2)*(PB(3))*(PC(3))*F&
      &1 + (PA(1))*((2*((PC(3))**(2)))/(2.d0))*F2 + (PA(1))*(((-1)*2*eps))*F1 + (PA(1)&
