      g(14,3) = +2*nuc(20,3) - 3*nuc(13,3) - 3*nuc(15,3)
      g(14,4) = +2*nuc(20,4) - 3*nuc(13,4) - 3*nuc(15,4)
      g(14,5) = +2*nuc(20,8) - 3*nuc(13,8) - 3*nuc(15,8)
      g(14,6) = +2*nuc(20,9) - 3*nuc(13,9) - 3*nuc(15,9)
      g(14,7) = +2*nuc(20,10) - 3*nuc(13,10) - 3*nuc(15,10)
      g(14,8) = +2*nuc(20,5) - 2*nuc(20,6) - 3*nuc(13,5)&
      + 3*nuc(13,6) - 3*nuc(15,5) +3*nuc(15,6)
      g(14,9) = +4*nuc(20,7) - 2*nuc(20,5) - 2*nuc(20,6)&
      - 6*nuc(13,7) + 3*nuc(13,5) + 3*nuc(13,6)&
      - 6*nuc(15,7) + 3*nuc(15,5) + 3*nuc(15,6)
      g(14,10) = +2*nuc(20,11) - 3*nuc(13,11) - 3*nuc(15,11)
      g(14,11) = +2*nuc(20,13) - 2*nuc(20,15) - 3*nuc(13,13)&
      + 3*nuc(13,15) - 3*nuc(15,13) + 3*nuc(15,15)
      g(14,12) = +2*nuc(20,18) - 6*nuc(20,14) - 3*nuc(13,18)&
      + 9*nuc(13,14) - 3*nuc(15,18) + 9*nuc(15,14)
      g(14,13) = +6*nuc(20,12) - 2*nuc(20,19) - 9*nuc(13,12)&
      + 3*nuc(13,19) - 9*nuc(15,12) + 3*nuc(15,19)
      g(14,14) = +4*nuc(20,20) - 6*nuc(20,13) - 6*nuc(20,15)&
      - 6*nuc(13,20) + 9*nuc(13,13) + 9*nuc(13,15)&
      - 6*nuc(15,20) + 9*nuc(15,13) + 9*nuc(15,15)
      g(14,15) = +8*nuc(20,16) - 2*nuc(20,18) - 2*nuc(20,14)&
      - 12*nuc(13,16) + 3*nuc(13,18) + 3*nuc(13,14)&
      - 12*nuc(15,16) + 3*nuc(15,18) + 3*nuc(15,14)
      g(14,16) = +8*nuc(20,17) - 2*nuc(20,12) - 2*nuc(20,19)&
      - 12*nuc(13,17) + 3*nuc(13,12) + 3*nuc(13,19)&
      - 12*nuc(15,17) + 3*nuc(15,12) + 3*nuc(15,19)
      g(15,1) = +4*nuc(16,1) - nuc(18,1) - nuc(14,1)
      g(15,2) = +4*nuc(16,2) - nuc(18,2) - nuc(14,2)
      g(15,3) = +4*nuc(16,3) - nuc(18,3) - nuc(14,3)
      g(15,4) = +4*nuc(16,4) - nuc(18,4) - nuc(14,4)
      g(15,5) = +4*nuc(16,8) - nuc(18,8) - nuc(14,8)
      g(15,6) = +4*nuc(16,9) - nuc(18,9) - nuc(14,9)
      g(15,7) = +4*nuc(16,10) - nuc(18,10) - nuc(14,10)
      g(15,8) = +4*nuc(16,5) - 4*nuc(16,6) - nuc(18,5)&
      + nuc(18,6) - nuc(14,5) + nuc(14,6)
      g(15,9) = +8*nuc(16,7) - 4*nuc(16,5) - 4*nuc(16,6)&
      - 2*nuc(18,7) + nuc(18,5) + nuc(18,6)&
      - 2*nuc(14,7) + nuc(14,5)+nuc(14,6)
      g(15,10) = +4*nuc(16,11) - nuc(18,11)-nuc(14,11)
      g(15,11) = +4*nuc(16,13) - 4*nuc(16,15) - nuc(18,13)&
      + nuc(18,15) - nuc(14,13) + nuc(14,15)
      g(15,12) = +4*nuc(16,18) - 12*nuc(16,14) - nuc(18,18)&
      + 3*nuc(18,14) - nuc(14,18) + 3*nuc(14,14)
      g(15,13) = +12*nuc(16,12) - 4*nuc(16,19) - 3*nuc(18,12)&
      + nuc(18,19) - 3*nuc(14,12) + nuc(14,19)
      g(15,14) = +8*nuc(16,20) - 12*nuc(16,13) - 12*nuc(16,15)&
      - 2*nuc(18,20) + 3*nuc(18,13) + 3*nuc(18,15)&
      - 2*nuc(14,20) + 3*nuc(14,13) + 3*nuc(14,15)
      g(15,15) = +16*nuc(16,16) - 4*nuc(16,18) - 4*nuc(16,14)&
      - 4*nuc(18,16) + nuc(18,18) + nuc(18,14)&
      - 4*nuc(14,16) + nuc(14,18) + nuc(14,14)
      g(15,16) = +16*nuc(16,17) - 4*nuc(16,12) - 4*nuc(16,19)&
      - 4*nuc(18,17) + nuc(18,12) + nuc(18,19)&
      - 4*nuc(14,17) + nuc(14,12) + nuc(14,19)
      g(16,1) = +4*nuc(17,1) - nuc(12,1) - nuc(19,1)
      g(16,2) = +4*nuc(17,2) - nuc(12,2) - nuc(19,2)
      g(16,3) = +4*nuc(17,3) - nuc(12,3) - nuc(19,3)
      g(16,4) = +4*nuc(17,4) - nuc(12,4) - nuc(19,4)
      g(16,5) = +4*nuc(17,8) - nuc(12,8) - nuc(19,8)
      g(16,6) = +4*nuc(17,9) - nuc(12,9) - nuc(19,9)
      g(16,7) = +4*nuc(17,10)  -nuc(12,10) - nuc(19,10)
      g(16,8) = +4*nuc(17,5) - 4*nuc(17,6) - nuc(12,5)&
      + nuc(12,6) - nuc(19,5) + nuc(19,6)
      g(16,9) = +8*nuc(17,7) - 4*nuc(17,5) - 4*nuc(17,6)&
      - 2*nuc(12,7) + nuc(12,5) + nuc(12,6)&
      - 2*nuc(19,7) + nuc(19,5) + nuc(19,6)
      g(16,10) = +4*nuc(17,11) - nuc(12,11) - nuc(19,11)
      g(16,11) = +4*nuc(17,13) - 4*nuc(17,15) - nuc(12,13)&
      + nuc(12,15) - nuc(19,13) + nuc(19,15)
      g(16,12) = +4*nuc(17,18) - 12*nuc(17,14) - nuc(12,18)&
      + 3*nuc(12,14) - nuc(19,18) + 3*nuc(19,14)
      g(16,13) = +12*nuc(17,12) - 4*nuc(17,19) - 3*nuc(12,12)&
      + nuc(12,19) - 3*nuc(19,12) + nuc(19,19)
      g(16,14) = +8*nuc(17,20) - 12*nuc(17,13) - 12*nuc(17,15)&
      - 2*nuc(12,20) + 3*nuc(12,13) + 3*nuc(12,15)&
      - 2*nuc(19,20) + 3*nuc(19,13) + 3*nuc(19,15)
      g(16,15) = +16*nuc(17,16) - 4*nuc(17,18) - 4*nuc(17,14)&
      - 4*nuc(12,16) + nuc(12,18) + nuc(12,14)&
      - 4*nuc(19,16) + nuc(19,18) + nuc(19,14)
      g(16,16) = +16*nuc(17,17) - 4*nuc(17,12) - 4*nuc(17,19)&
      - 4*nuc(12,17) + nuc(12,12) + nuc(12,19)&
      - 4*nuc(19,17) + nuc(19,12) + nuc(19,19)
      
      end if
                                                         
      end subroutine nucPotInteg


