      ! This subroutine computes the 2-center Kinetic Energy integrals
      ! according to the following form:
      ! ****************************************************************
      ! "Tables of Integrals, Series, and Products - 7th Edition" by
      ! I.S. Gradshteyn and I.M. Ryzhik
