      ! ISBN-13: 978-0-12-373637-6
      ! ISBN-10: 0-12-373637-4
      !
      ! ****************************************************************
      !
      ! This formalism computes the integral for a single dimension,
      ! then takes a product.  Azimuthal quantum numbers are grouped
      ! According using the formalism used in the following paper:
      !
      ! ****************************************************************
      ! Browne JC, Poshusta RD., "Quantum-Mechanical Integrals 
      ! over Gaussian Atomic Orbitals.", The Journal of Chemical Physics, 
      ! Vol. 36, Iss. 7, P. 19337, (1962).
      ! ****************************************************************
