      ! It's necessary to visualize this sum using terms called I_x,
      ! I_y, and I_z.  Each of the overlap terms is multiplied by a 
      ! constant, and some of the terms have +2 or -2 added to its
      ! l2 angular momentum variable.  Let <+-n|+-n>_x denote an 
      ! overlap integral for the x-dimension, with the angular 
      ! momentum increased or decreased by n.  Using this notation,
      ! the terms of the KE overlap integral are as follows:
