      ! I_y = a2*(2*l2[1]+1)*<0|0> - 2*(a2**2)*<0|+2>_y - ((l2[1]*(l2[1]-1))/2)*<0|-2>_y
      ! I_z = a2*(2*l2[2]+1)*<0|0> - 2*(a2**2)*<0|+2>_z - ((l2[2]*(l2[2]-1))/2)*<0|-2>_z
