! This subroutine computes the 2-center overlap integrals for
! s-, p-, d-, or f-type Gaussian orbitals.
      subroutine overlapInteg(a1,a2,A,B,l1l2switch,g)

      use O_Kinds
      use O_Constants, only: pi

      implicit none
! c
! c     g(16,16): 1,s; 2,x; 3,y; 4,z; 5,xy; 6,xz; 7,yz; 8,xx-yy;
! c     9,2zz-xx-yy; 10,xyz; 11,xxz-yyz; 12,xxx-3yyx; 13,3xxy-yyy; 
! c     14,2zzz-3xxz-3yyz; 15,4zzx-xxx-yyx; 16,4zzy-xxy-yyy
! c
! c     wo(20,20): 1,s; 2,x; 3,y; 4,z; 5,xx; 6,yy; 7,zz; 8,xy; 9,xz;
! c     10,yz; 11,xyz; 12,xxy; 13,xxz; 14,yyx; 15,yyz; 16,zzx; 17,zzy
! c     18,xxx; 19,yyy; 20,zzz
! c 
      ! define the dummy variables passed to this subroutine.
      real (kind=double), dimension (16,16), intent (out) :: g
      real (kind=double), intent (in) :: a1, a2
      real (kind=double), dimension (3), intent (in) :: A, B
      integer, intent (in) :: l1l2switch

      ! define local variables
      real (kind=double), dimension (20,20) :: wo
      real (kind=double), dimension (3) :: P, PA, PB, d
      real (kind=double) :: Y, preFactor, expFactor
      P = (a1*A + a2*B)/(a1 + a2)
      PA = P - A
      PB = P - B
      Y = a1 + a2
      d = A - B
      expFactor = sum(a1*a2*(d**2))/Y
      preFactor = ((pi/Y)**1.5)*exp(-(expFactor))

      if (l1l2switch.eq.34) then

      wo(1,1) = preFactor
      
      wo(1,2) = preFactor*((PB(1)))
      
      wo(1,3) = preFactor*((PB(2)))
      
      wo(1,4) = preFactor*((PB(3)))
      
      wo(2,1) = preFactor*((PA(1)))
      
      wo(2,2) = preFactor*((PA(1)*PB(1) + (1/(2*Y))))
      
      wo(2,3) = preFactor*((PA(1))*(PB(2)))
      
      wo(2,4) = preFactor*((PA(1))*(PB(3)))
      
      wo(3,1) = preFactor*((PA(2)))
      
      wo(3,2) = preFactor*((PB(1))*(PA(2)))
      
      wo(3,3) = preFactor*((PA(2)*PB(2) + (1/(2*Y))))
      
      wo(3,4) = preFactor*((PA(2))*(PB(3)))
      
      wo(4,1) = preFactor*((PA(3)))
      
      wo(4,2) = preFactor*((PB(1))*(PA(3)))
      
      wo(4,3) = preFactor*((PB(2))*(PA(3)))
      
      wo(4,4) = preFactor*((PA(3)*PB(3) + (1/(2*Y))))
      
      g(1,1) = +wo(1,1)
      g(1,2) = +wo(1,2)
      g(1,3) = +wo(1,3)
      g(1,4) = +wo(1,4)
      g(2,1) = +wo(2,1)
      g(2,2) = +wo(2,2)
      g(2,3) = +wo(2,3)
      g(2,4) = +wo(2,4)
      g(3,1) = +wo(3,1)
      g(3,2) = +wo(3,2)
      g(3,3) = +wo(3,3)
      g(3,4) = +wo(3,4)
      g(4,1) = +wo(4,1)
      g(4,2) = +wo(4,2)
      g(4,3) = +wo(4,3)
      g(4,4) = +wo(4,4)
      
      else if (l1l2switch.eq.17) then
      
      wo(1,1) = preFactor
      
      g(1,1) = +wo(1,1)
      
      else if (l1l2switch.eq.33) then
      
      wo(1,1) = preFactor
      
      wo(1,2) = preFactor*((PB(1)))
      
      wo(1,3) = preFactor*((PB(2)))
      
      wo(1,4) = preFactor*((PB(3)))
      
      g(1,1) = +wo(1,1)
      g(1,2) = +wo(1,2)
      g(1,3) = +wo(1,3)
      g(1,4) = +wo(1,4)
      
      else if (l1l2switch.eq.65) then
      
      wo(1,1) = preFactor
      
      wo(1,2) = preFactor*((PB(1)))
      
      wo(1,3) = preFactor*((PB(2)))
      
      wo(1,4) = preFactor*((PB(3)))
      
      wo(1,5) = preFactor*(((PB(1)**2) + (1/(2*Y))))
      
      wo(1,6) = preFactor*(((PB(2)**2) + (1/(2*Y))))
      
      wo(1,7) = preFactor*(((PB(3)**2) + (1/(2*Y))))
      
      wo(1,8) = preFactor*((PB(1))*(PB(2)))
      
      wo(1,9) = preFactor*((PB(1))*(PB(3)))
      
      wo(1,10) = preFactor*((PB(2))*(PB(3)))
      
      g(1,1) = +wo(1,1)
      g(1,2) = +wo(1,2)
      g(1,3) = +wo(1,3)
      g(1,4) = +wo(1,4)
      g(1,5) = +wo(1,8)
      g(1,6) = +wo(1,9)
      g(1,7) = +wo(1,10)
      g(1,8) = +wo(1,5) - wo(1,6)
      g(1,9) = +2*wo(1,7) - wo(1,5) - wo(1,6)
      
      else if (l1l2switch.eq.129) then
      
      wo(1,1) = preFactor
      
      wo(1,2) = preFactor*((PB(1)))
      
      wo(1,3) = preFactor*((PB(2)))
      
      wo(1,4) = preFactor*((PB(3)))
      
      wo(1,5) = preFactor*(((PB(1)**2) + (1/(2*Y))))
      
      wo(1,6) = preFactor*(((PB(2)**2) + (1/(2*Y))))
      
      wo(1,7) = preFactor*(((PB(3)**2) + (1/(2*Y))))
      
      wo(1,8) = preFactor*((PB(1))*(PB(2)))
      
      wo(1,9) = preFactor*((PB(1))*(PB(3)))
      
      wo(1,10) = preFactor*((PB(2))*(PB(3)))
      
      wo(1,11) = preFactor*((PB(1))*(PB(2))*(PB(3)))
      
      wo(1,12) = preFactor*(((PB(1)**2) + (1/(2*Y)))*(PB(2)))
      
      wo(1,13) = preFactor*(((PB(1)**2) + (1/(2*Y)))*(PB(3)))
      
      wo(1,14) = preFactor*((PB(1))*((PB(2)**2) + (1/(2*Y))))
      
      wo(1,15) = preFactor*(((PB(2)**2) + (1/(2*Y)))*(PB(3)))
      
